• Snijd een courgette open en schep met een lepel de binnenkant er uit (niet weggooien) en doe de courgette 10 minuutjes in de oven.
• Bak een uitje en knoflook in wat olijfolie en voeg een paprika en het vruchtvlees van de courgette toe.
• Doe hierna een blikje tomatenpuree en kruiden erbij (peper, zout en paprikapoeder).
• Voeg de gekookte, gekruide Marrokkaanse couscous toe (deze kun je gekruid kopen in de supermarkt) en schep alles in de courgette.
